import moment from "moment";
import {Button, Card, CardBody, CardSubtitle, CardTitle, Modal, ModalBody, ModalHeader, Table} from "reactstrap";
import React, {useState} from "react";

const WorkoutDayCard = ({date}) => {

    const [modal, setModal] = useState(false);

    const toggle = () => {
        setModal(!modal);
    };

    const day = moment(date).format('ddd');

    return (
        <Card>
            <CardTitle>{day}</CardTitle>
            <CardSubtitle>Push</CardSubtitle>
            <CardBody>
                <Table>
                    <thead>
                    <tr>
                        <th>Exercise</th>
                        <th>Reps</th>
                        <th>Sets</th>
                        <th>Achieved</th>
                    </tr>
                    </thead>
                    <tbody>
                    {/*workout content*/}
                    </tbody>
                </Table>
            </CardBody>
            <Button onClick={toggle}>Create Workout</Button>
            <Modal isOpen={modal} toggle={toggle}>
                <ModalHeader toggle={toggle}>Create a workout</ModalHeader>
                <ModalBody>
                </ModalBody>
            </Modal>
        </Card>
    )
};

export default WorkoutDayCard;
